import React from 'react';
import styled from "styled-components";
import Whyusimgtom from "../images/whyustop.PNG";
import Carousel from "react-elastic-carousel";


const AppContainer = styled.div`
  
  //background-image: url(https://lh3.googleusercontent.com/proxy/uEMG09-6YIt84vPjSuPdz7JguDNgCETxa0BsPow-S3fG9RZOQNSlHpztptXOD6hjLJaKma45pKz_qflPmPkqHvcxQy3sdgcd4gatO6d2ng5Vxuy_Ful99NUG5RTJAWE6QQiB2o8x9S5JZUP5Xgftyxu3EkCbusS3u3hXTqSNwBGOdwVa8QaMB1si9_GPK9vRjgGYC4yUkbnpsk_QzLFWrw);
   background-Size: 50%;
  //  width: 2200px;
    height: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
   background: rgb(50,142,65);
  // background: linear-gradient(90deg, rgba(50,142,65,1) 4%, rgba(70,106,166,0.938813025210084) 100%, rgba(0,212,255,1) 100%);
`;

const WhyusContainer = styled.div`
  
//background: #000;
    width: 80%;
    height: 450px;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: top;
    margin-bottom: 5%;
 
`;

const WhyusContainer1 = styled.div`
  
 
    width: 100%;
    height: 300px;
    background: #999;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: top;
    margin-bottom: 5%;
 
`;


const ServicesContainer = styled.div`
  
 
    width: 80%;
    height: 300px;
    background: #999;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: bottom;
    margin-bottom: 5%;
    border-radius: 50px;
 
`;


const CountContainer = styled.div`
  
 
    width: 80%;
    height: 150px;
    background: #999;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: bottom;
    margin-bottom: 5%;
    
`;

const PopcarandlocContainer = styled.div`
  
 
width: 100%;
height: 450px;
background: #999;
display: flex;
flex-direction: column;
align-items: center;
justify-content: bottom;
margin-bottom: 5%;


`;

const PartnersContainer = styled.div`
  
 
    width: 90%;
    height: 300px;
    background: #999;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: bottom;
    margin-bottom: 5%;
    
`;


const Imgwhyustop = styled.img`
  
 
     width: 100%;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: top;
    margin-bottom: 5%;
    margin-top: 3%;
    border-radius: 20px;
    
 
`;


const Item = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 200px;
  width: 90%;
  background-color: #00008B;
  color: #fff;
  margin: 1px;
  
`;

const breakPoints = [
  
  { width: 1, itemsToShow: 1 },
  { width: 350, itemsToShow: 2 },
  { width: 500, itemsToShow: 3 },
  { width: 600, itemsToShow: 4 },
  { width: 950, itemsToShow: 5 },
];


const Home = () => {
  return (
    <div>
      <AppContainer >

        <h1 style={{ display: 'flex', justifyContent: 'center', alignItems: 'top', height: '100%' }}>home</h1>







        <WhyusContainer >
          <Imgwhyustop src={Whyusimgtom} width='80%' height='60px' alt="top" />

          <WhyusContainer1 >


          </WhyusContainer1>







        </WhyusContainer>




















        <ServicesContainer>
          <h1 style={{ display: 'flex', justifyContent: 'center', alignItems: 'top', height: '100%' }}>ServicesContainer</h1>

        </ServicesContainer>

        <CountContainer>
          <h1 style={{ display: 'flex', justifyContent: 'center', alignItems: 'top', height: '100%' }}>countContainer</h1>
        </CountContainer>

        <PopcarandlocContainer>
          <h1 style={{ display: 'flex', justifyContent: 'center', alignItems: 'top', height: '100%' }}>popcarandlocContainer</h1>

        </PopcarandlocContainer>


        <PartnersContainer>
          <h1 style={{ display: 'flex', justifyContent: 'center', alignItems: 'top', height: '100%' }}>PartnersContainer</h1>
        
        
          <Carousel breakPoints={breakPoints} justify-content='center' align-items= 'center'>
          <Item>  <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/44/BMW.svg/2048px-BMW.svg.png"  width="100%" height="100%" alt="bmw" />   </Item>
          <Item>  <img src="https://lh3.googleusercontent.com/proxy/YsSC_HNvZTcDb6oqQC0411eauC1CyMYxrTXwLxcWFuIZDdnqJ1Nw-JrsB2jL5j8CDpC90GDuEdE9xHOxd2-BNeHbdeh8MHRzaehG-lCr2vdOQpjR_MIB5l7BPchAc1nerr6qw3IrNw6sIQ"  width="100%" height="100%" alt="toyota" /> </Item>
          <Item> <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/44/BMW.svg/2048px-BMW.svg.png"  width="100%" height="100%" alt="bmw" /> </Item>
          <Item> <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/44/BMW.svg/2048px-BMW.svg.png"  width="100%" height="100%" alt="bmw" /> </Item>
          <Item> <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/44/BMW.svg/2048px-BMW.svg.png"  width="100%" height="100%" alt="bmw" /> </Item>
          <Item> <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/44/BMW.svg/2048px-BMW.svg.png"  width="100%" height="100%" alt="bmw" /> </Item>
          <Item> <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/44/BMW.svg/2048px-BMW.svg.png"  width="100%" height="100%" alt="bmw" /> </Item>
          <Item> <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/44/BMW.svg/2048px-BMW.svg.png"  width="100%" height="100%" alt="bmw" /> </Item>
        </Carousel>
        
        
        
        </PartnersContainer>






      </AppContainer>








    </div>
  );
};

export default Home;
